// src/components/MemoList.js

import React from 'react';
import MemoItem from './MemoItem';

const MemoList = ({ memos, onDelete }) => {
  return (
    <div>
      <h2>Memo List</h2>
      <table>
        <tbody>
          <tr>
          <td><b>title</b></td>
          <td><b>content</b></td>
          <td><b>button</b></td>
          </tr>
        {memos.map((memo) => (
          <MemoItem key={memo.id} memo={memo} onDelete={onDelete} />
        ))}
        </tbody>
      </table>
    </div>
  );
};

export default MemoList;
